                <p>My name is Micha≈Ç Mikulski. I have been programming since I started attending high school. I am comfortable and enjoy coding front-end and back-end applications. Nonetheless I am just a beginner and I am constantly learning new skills and mastering the ones i have.</p>
            </div>
            <div className="aboutme-schools">
                <h3>Education</h3>
                <h5>2016-2020</h5>
                <p>Upper-Secondary School of Communications in Cracow</p>
